import React from "react";

function sayHello() {
  console.log("Hello");
}

const Header = (props) => {
  return <h1>{props.text}</h1>;
};

class Button extends React.Component {
  constructor() {
    super();
    this.state = { counter: 0 };
  }

  handeButtonClick() {
    this.setState({counter:1 });
  }

  render() {
    return <button onClick={sayHello}>{this.state.counter}</button>
  }
}

class App extends React.Component {
  render() {
    return(
      <>
        <Header text="Hey you" />
        <Header text="You are super" /> 
        <Button label="Submit"/>
        <Button label="Cancel"/>
      </>
    )
  }
}

export default App;
